import React, { Component, createContext } from 'react'
//import '../App.css'
import Pop from './pop'


class Header extends React.Component {
    constructor(props) {
      super(props);
    
      this.state = {value: 'Goa',
      selectedcity: 'Banglore',
      citypopvisible: 'false',
    };
  
      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
      this.handleCity = this.handleCity.bind(this);
    }

    


    handleChange(event) {
        this.setState({value: event.target.value});
      
      }

      handleCity(event) {
        this.setState({citypopvisible: true});
       
      }
    
      handleSubmit(event) {
        alert('Your City is: ' + this.state.value);
        <Pop />
        event.preventDefault();
      }
   
  
    render() {
      return (
        <header>
        <div class="main">
            
                <button><a href="#"><img src={'images/carwalelogo.png'} width="30" height="30" /></a></button>
                <button  onClick={this.handleSubmit}><a href="#"><img src={'images/locationLogo.png'} width="30" height="30" /></a></button>
                <Pop />
        </div>
    </header>

  
      );
    }
  }
  



export default Header;
